import ProfileStatus from "./ProfileStatus";


const ProfileInfo = (props) => {

    if(!props.props){
        return <Preloder />
    }
    debugger
    return (

        <Col xs='12'>
            <Row>
            <Col xs='12'>
                <img className={styles.wallper} src={wallper}></img>
            </Col>
            <Col xs='6' className = 'kkkkk'>
                <img src={props.props.photos.large} alt=""/>
            </Col>
            <ProfileStatus status={props.props.aboutMe}/>
            <Col xs='12'>my/new posts</Col>
                <Col>
                    <span>Contacts: </span>
